PCBasic JS Technology Co., Ltd интеллектуальная фабрика, специализирующаяся на комплексном обслуживании и быстром многообразном мелкосерийном и крупносерийном производстве печатных плат. Мы являемся компанией по производству ,проектированию , изготовлению и монтажу 
многослойных печатных плат.

PCBasic JS Technology Co., Ltd выше 15 лет предоставляет услуги по контрактному производству печатных плат, включая:
 проектирование топологии печатных плат;
 изготовление печатных плат;
 изготовление металлических экранов;
 закупка комплектации для контрактных заказов;
 монтаж печатных узлов.

Honcell Energy — ведущий производитель литий-полимерных (Li-ion) и LiFePO4 аккумуляторов с 2010 года (Шэньчжэнь, Китай). Специализируемся на комплексных решениях для мирового рынка.
Основные компетенции:
Производство литий-полимерных ячеек (Li-Polymer Cells), включая высокотоковые модели (High Discharge Li-Polymer Cells) и LiFePO4 элементы;
Разработка аккумуляторных сборок: литий-полимерных (Li-Polymer Battery Packs), высокомощных (High Drain Lipo Battery Packs), LiFePO4 систем и цилиндрических сборок (Cylindrical Battery Packs);
Полный цикл OEM/ODM услуг по индивидуальному проектированию литиевых аккумуляторов.
Наши решения сочетают глубокие технические экспертизы с гибкостью под требования заказчика.

(Hong Kong Core Century) Limited надеется на сотрудничество с вами, Уверены, что наше сотрудничество будет взаимовыгодным и плодотворным.С 2004 года мы являемся ключевым бизнес-партнером для многих ИТ-реселлеров, производителей и разработчиков, тесно сотрудничая с нашими клиентами в области продаж и установки оборудования и программного обеспечения.За последние 18 лет мы успешно сегментировали наш бизнес на пять основных продуктов: интегральные схемы, конденсаторы, модули, диоды и разъемы.В настоящее время мы- как следующие авторизованные агенты бренда:
SIMCOM, SEMITEL, Fogang, Foshan Semiconductor;
 преимущество заключается в том, что мы как  дилера следующих брендов ADl、TI、ST、ON、XILINX、ALTERA、Infineon、NXP，MICROCHIP、LINEAR、SAMSUNG. Вышеуказанные продукты могут быть заказаны.

Topovision - это высокотехнологичное предприятие, которое тесно сотрудничает со многими близлежащими заводами и поставщиками, и мы используем наши
Богатый глобальный опыт торговли и технические знания LCD / LCM помогут вам во многих областях:
1. Найти оптимальные и подходящие источники;
Полное комплексное решение для панелей, техническая поддержка и дизайн;
3. Обеспечить оптимальную доставку;
4. Предложить наиболее выгодные цены;
Поддержка предоставляется не только до заказа, но и после изготовления и продажи. Мы фокусируемся на проектировании и производстве.
Малые и средние дисплеи имеют более чем 17 - летнюю историю; Мы фокусируемся на разработке, настройке
Технологии Mono, TFT, OLED - дисплеев и приводных панелей, включая воздушный зазор и оптическую связь CTP

Основные виды средств силовой электроники, выпускаемых НТЦ АКТОР:
• источники электропитания (преобразователи напряжения) постоянного и переменного тока;
• авиационные преобразователи частоты и напряжения (статические преобразователи и выпрямители);
• адаптивные системы преобразования параметров электроэнергии с повышенными показателями безотказности;
• автономные технические средства, комплекты, автоматизированные комплексы имитации видов и значений параметров качества электроэнергии СЭС постоянного и переменного тока для наземного, авиационного и морского направления техники;
• регистраторы параметры качества электроэнергии;
• управляемые силовые коммутационные устройства;
• управляемые эквиваленты электрической нагрузки.

АО «АНТЕКС» было основано в 2008 г. и занималось разработкой ПО и антенных систем, проведением НИР и ОКР в интересах МО РФ. В 2010 году АО «АНТЕКС» начало развивать деятельность по разработке и производству СВЧ компонентов с целью замещения импортных изделий. 
На 2025 г. основными направлениями Компании являются разработка, производство и поставка:
·Фазостабильных радиочастотных кабелей СВЧ диапазона;
·Сборок кабельных радиочастотных;
·Соединителей, переходников радиочастотных, СВЧ компонентов;
·Радиочастотной кабельной продукции широкого потребления;
·Сборок кабельных на соединителях производства ПАО «Завод «АТЛАНТ».
Продукция изготавливается как по собственным ТУ, так и по ТЗ/ТТ Заказчика. СМК в соответствии с ГОСТ РВ 0015-002-2020. Состоит в реестре ОПК. Резидент ОЭЗ ТВТ "Исток".

АО "Арсенал" КрЗПП" - ведущее предприятие в России по разработке и серийному производству полупроводниковых и электротехнических компонентов. 

Основные направления серийного производства:
∙ транзисторы и диоды в металлополимерных корпусах для поверхностного монтажа;
∙ интегральные микросхемы;
∙ мощные карбид-кремниевые транзисторы;
∙ высокочастотные кабельные сборки;
∙ низкочастотные электрические жгуты;
∙ ответвители мультиплексного канала передачи данных (МКИО).

АО «НПК «АТРОНИК» имеет уникальный набор компетенций в разработке и серийном производстве спецвычислителей и бортовых компьютеров.

Основными направлениями деятельности НПК «АТРОНИК» являются:
- разработка и серийное производство специализированных вычислителей для тяжелых условий эксплуатации;
- разработка сложной электроники по ТЗ заказчика.
- разработка и производство устройств биометрической идентификации;

НПП “ГАММАМЕТ” производит аморфные и нанокристаллические сплавы на основе современной технологии сверхскоростной закалки металлического расплава. Предприятие обладает полным циклом производства от выплавки сплава и разливки ленты до изготовления магнитопроводов и электромагнитных изделий на их основе.
• производство магнитопроводов из аморфных и нанокристаллических сплавов;
• производство датчиков тока, измерительных трансформаторов тока и напряжения, высокочастотных трансформаторов, электрических реакторов различного назначения.

Наши компетенции: 

Физическая дистрибуция любых групп товаров;
Оперативный консалтинг постоянных клиентов;
Финансовая логистика, альтернативные способы финансовых сделок;
Анализ и поиск решений проблем, при сбоях производственных цепочек;
Организация новых международных структур, во всех регионах мира, под потребности наших клиентов.

АО «Дубненский завод коммутационной техники» - ведущее предприятие в России по разработке и серийному производству электрических соединителей и коммутационной техники.

Основными видами продукции предприятия являются:
- электрические и оптические соединители;
- быстроразъемные соединения для гидро- и пневмосистем;
- герметичные соединители, в том числе «мокрой» стыковки;
- СВЧ-соединители, делители, МШУ и кабельные сборки;
- контакторы, концевые выключатели, автоматы защиты, лампы-кнопки.

ИНЕЛСО – это комплексное решение задач заказчика любой сложности:
Поставки приводных решений, контроллеров управления двигателями, датчиков параметров движения и положения;
Поставки инерциальных систем и датчиков;
Поставки   и подбор замен электронных компонентов ;
Поставки и подбор аналогов электромеханических компонентов;
Поставки источников питания малой, средней и большой мощности;
Производство российской линейки сервоприводов и энкодеров;
Производство инерциальных модулей;
Поставки печатных плат и клавиатур.

АО «НТЦ «Интернавигация»:
- рабочий орган МГС «Радионавигация» государств – участников СНГ;
- участвует в международных проектах по вопросам создания объединенных цепей импульсно-фазовых РНС, взаимодействуя с ICAO, IMO, Международной ассоциацией маячных служб (ILA), Дальневосточной радионавигационной службой (FERNS) и др. 
- обеспечивает административное управление и организацию эксплуатации российских станций, входящих в состав объединенных наземных радионавигационных систем;
- проектирует и изготовляет антенно-мачтовые сооружения высотой до 100 м;
- издает журнал «Новости навигации»

Холдинг Информтест - российский производитель испытательного оборудования в открытых стандартах AXIe, PXIe, LXI, и VXI. Основные направления работы - это разработка и производство:
- широкой линейки модульных приборов для создания КПА
- тестеров проводного монтажа кабелей серии ТЕСТ-9110;
- системы функционального контроля;
- тестеры микросхем;
- систем телеметрии и управления для стендовых испытаний;
- аппаратуры для испытания сложных объектов контроля;

"Конкур Электрик" - дистрибьютор электронных компонентов в России и СНГ. Ключевое место в программе поставок занимают:
- элементы защиты: предохранители(одноразовые, самовосстанавливающиеся, силовые), TVS-диоды, варисторы, газоразрядники, термисторы, дискретные полупроводники (Thinking Electronic, SETfuse, Vicfuse, Shikues, WAYON, HUAAN); 
- устройства защиты, УЗИП (SETfuse, Commeng); 
- электромеханические реле и термопринтеры (Fujitsu Components, Fanhar); 
- разъёмы, держатели, сборки (Attend, Oupiin); 
- сенсорные панели различных технологий (Sinotectronics). 
Так же представлены  ЖК-дисплеи (HTDisplay), MOSFET - транзисторы (WAYON, JJ Micro), источники питания, трансформаторы, дроссели (PAIRUI).

ООО "Лаборатория вакуумных технологий плюс" - отечественный производитель вакуумного технологического оборудования, установок для напыления и плазмохимии НИКА и комплектующих и блоков вакуумных систем. 
Доступные к применению технологии: PVD, СVD, PECVD, IА или PARMS, PCE, IPST, IVD, IPN/C, EBT, PPDV, DLC, AV или КИБ, IE, HiPIMS, TD  / TE, TDMD.
ЛВТ+ предлагает готовые решения дря различных отраслей: 
• производство инструмента – от покрытий на малогабаритный инструмент до пресс-форм, ленточных и больших дисковых пил;
• авиационная промышленность – термостойкие, термобарьерные, износоустойчивые покрытия;
• автомобильная промышленность – для нанесения защитных, коррозионостойких, декоративных покрытий;
• медицина – биосовместимые покрытия для имплантов, эндопротезов.

ООО «ЛАССО-центр» 27 лет успешно и стабильно работает на рынке электронной промышленности. Компания обеспечивает предприятия, производящие печатные платы, новыми технологиями, оборудованием, материалами импортного и отечественного производства.
В настоящее время налажены поставки материалов из Китайской НР: 
- фототехническая пленка HUAGUANG, химия для ее обработки; 
- сухой пленочный фоторезист FIRST и HORI; 
- сухая защитная маска FIRST; 
- жидкая защитная паяльная маска RONGDA, COANTS; 
- маркировочные чернила RONGDA, HUAGUANG; 
- белые и черные маркировочные чернила для струйного принтера RONGDA; 
- химические составы ZTW (подготовка поверхности, кислотный очиститель, состав для снятия фоторезиста и маски, флюс, пеногасители).

«ЛионТех-С» является официальным представителем ведущих мировых производителей оборудования и расходных материалов. Мы предлагаем нашим партнерам как комплексные решения в широком спектре возникающих задач, так и помощь в обретении компетенций и развитии персонала. 
Наши услуги:
• Подбор и поставка оборудования для монтажа компонентов;
• Аудит технологических процессов;
• Разработка проектно-конструкторской документации производственных помещений;
• Пусконаладочные работы;
• Обучение специалистов заказчика;
• Гарантийное и постгарантийное обслуживание оборудования;
• Подбор и поставка паяльных и расходных материалов;
• Консультации на всех этапах.

«Матрикс Электроника» — авторизованный дистрибьютор китайских производителей и поставщик американских брендов для серийного производства электроники.
Помимо оптовых поставок электронных компонентов, мы занимаемся контрактной сборкой, производством печатных плат и кабельных сборок. 
Готовы поддержать Вас на всех уровнях:  
- Подобрать аналоги и оптимальные предложения благодаря широкому охвату рынка через собственную it-систему и развитию дистрибьюторских отношений с ведущими китайскими вендорами;  
- Поставить оригинальные компоненты европейских и американских брендов с обязательным двухэтапным входным контролем в Китае и РФ; 
- Обеспечить стабильные серийные поставки и поддержку от производителя;  
- Предоставить гибкие финансовые условия; 
- Предложить решения нестандартных задач.

ООО «Мелитэк» поставляет, внедряет и выполняет сервисное обслуживание оборудования по направлениям:
• спектрометры химического состава материалов и дифрактометры фазового состава материалов;
• оптическая и масс-спектроскопия;
• оборудование для подготовки;
• микроскопы и цифровые камеры;
• твердомеры;
• оборудование для измерения в нанометровом диапазоне;
• сканирующие электронные микроскопы;
• испытательные машины;
• высокочастотные (резонансные) испытательные системы;
• высокоточные рентгенодиагностические системы;
• термоанализ и реология.

Производство электромагнитных компонентов (трансформаторы дроссели, магнитопроводы):
- аморфные и нанокристаллические ленты АМАГ толщиной от 17 до 25 мкм 
- магнитопроводы аморфные и нанокристал.;
- разрезные магнитопроводы;
- синфазные дроссели нанокристаллические;
- чип катушки индуктивности (SMD);
- трансформаторы импульс. и блоки ИТ (MIL-STD-1553B);
- трансформаторы для Ethernet;
- намотка рядовая и тороидальная проводом по тех. заданию клиента.

Завод МСТАТОР постоянно расширяет возможности производства современных пассивных электромагнитных компонентов для нужд Российской Электроники.
Производство трансформаторов и дросселей с повышенной энергоэффективностью в импульсных ИП, качественным помехоподавлением и надёжной передачей сигнала.
Активное участие в импортозамещении.

Акционерное общество «Научно-исследовательский институт полупроводниковых приборов» один из лидеров в области создания СВЧ-изделий и оптоэлектронных приборов ИК- и видимого диапазона в России, входящий в госкорпорацию «РОСТЕХ».

АО «НИИПП» — это современное высокотехнологичное инновационное предприятие полного цикла, включающее «разработку – производство – продажу».

Основная продукция НИИПП это: 
• модули и сложно-функциональные СВЧ-устройства;
• дискретные полупроводниковые приборы; 
• монолитные и гибридные интегральные;
• оптоэлектроника и светотехника (светодиоды ИК- и видимого диапазона, светодиодные светильники и др.);
• медицинская техника;
• промышленная электроника.

Вся продукция предприятия соответствует заявленным характеристикам и обладает высокой надежностью.

АО «Протон» является ведущим производителем оптоэлектронной техники в России. Предприятие успешно работает на рынке с 1972 года и владеет современными технологиями по производству оптоэлектронных приборов, осуществляет полный цикл производства от кристаллов до законченных изделий.

Предприятие специализируется на производстве:
ярких светодиодов, модулей и индикаторов;
оптронов и твердотельных реле;
светодиодных светильников, в том числе взрывозащищенных, ламп и подсветок;
светодиодных светофоров и табло, заградительных огней.
Предприятие сертифицировано по международной системе менеджмента качества ISO 9001:2008 и ГОСТ РВ15.002-2003, что подтверждено сертификатами и лицензиями, имеет систему технической приемки продукции Представительством Заказчика Минобороны России.

АО «Протон-Электротекс» - производственное предприятие, сферой деятельности которого является разработка и производство силовых полупроводниковых приборов и сборок на их основе.

Предприятие серийно производит следующие типы продукции:
- силовые диоды и тиристоры в модульном, штыревом и таблеточном исполнении;
- IGBT-модули;
- системы охлаждения полупроводниковых приборов;
- драйверы управления;
- силовые выпрямительные и инверторные блоки, ключи переменного тока.

ООО «Радиокомп» – многопрофильное предприятие, работающее на рынке разработок, производства, испытаний и поставки радиоэлектронной продукции.    
На предприятии накоплен значительный опыт в области разработки и изготовления синтезаторов частот. 
Направления деятельности: 
1.Разработка и производство фильтров ВЧ/СВЧ и устройств на их основе.    
2.Разработка и изготовление синтезаторов частот и сигналов, передающих и приемных устройств для РЛС, средств для систем программно-определяемого радио, усилителей, переключателей ВЧ сигналов, устройств обработки видеоинформации;  
3.Программная реализация алгоритмов обработки сигналов в радиосистемах; 
4. Испытания ЭКБ в широкой области аккредитации;

ООО «Синтез-ПКЖ» является единственным производителем порошков карбонильного железа радиотехнических марок в России и странах СНГ. 
По программе импортозамещения освоено производство СЕРДЕЧНИКОВ КАРБОНИЛЬНЫХ РАДИОТЕХНИЧЕСКИХ, которые являются аналогами импортных сердечников поставляемых в РФ.
Сердечники из карбонильного железа, обладают высокой стабильностью параметров в широком диапазоне температур и уровней магнитного потока в диапазоне от 50 кГц до 200 МГц.
Области применения продукции компании «Синтез-ПКЖ»:
-Радиоэлектроника и радиопоглощение;
-Алмазный инструмент;
-Производство деталей методом инжекционного формования металла (бытовая техника, электроника, аэрокосмическая отрасль и пр.);
-Исходное сырье для фармацевтической промышленности
- металломатричные композиты.

Предприятие осуществляет свою деятельность с 2000 года. Благодаря собственной материально-технической базе, новаторским идеям и потенциалу сотрудников предприятия, нам удалось достигнуть уровня импортозамещающей продукции, отвечающей высоким требованиям к качеству, внешнему виду и функциональным возможностям производимого оборудования.

Основные виды производимых изделий:
многоканальные транспонаторы частоты в диапазоне от 9 кГц до 60 ГГц;
радиоприемные устройства в диапазоне частот от 9 кГц до 110 ГГц;
элементы антенно-фидерного тракта и антенно-фидерных систем в диапазоне частот от 9 кГц  до 110 ГГц;
измерительные антенны в диапазоне частот от 10 Гц (!) до 110 ГГц;
комплексы радиомониторинга и радиотехнической обработки сигналов в диапазоне частот от  9 кГц до 60 ГГц.

