Электроконнект — завод по производству печатных плат

Электроконнект – один из крупнейших производителей печатных плат в России. Завод основан в 1991году. Работа по развитию продукта и внедрению инноваций в производстве помогает уверенно удерживать высокие позиции в рейтинге российских производителей электроники. 
Электроконнект сейчас — это:
• производственные мощности до 30 000 м² печатных плат в год;
• свыше 6 000 м² производственных площадей;
• более 12 000 заказчиков от Минска до Владивостока;
• современное оборудование и постоянное модернизация и дооснащение производства;
• собственные инновационные разработки технологии производства печатных плат;
• система контроля качества ISO 9001, ГОСТ РВ 15.002, ГОСТ,  IPC.

